import{_ as t,c as a,o as n,ae as i}from"./chunks/framework.DlU1FK7t.js";const p=JSON.parse('{"title":"","description":"","frontmatter":{"layout":"home","hero":{"name":"Deep mutational scanning of CHIKV envelope proteins","tagline":"Interactive visualizations of how mutations to the envelope proteins of the 181/25 strain of Chikungunya virus (CHIKV) affect entry in 293T-Mxra8, 293T-TIM1, and C6/36 cells, as well as Mxra8 binding","image":"CHIKV-E.png"},"features":[{"title":"Cell entry","details":"Mutation effects on entry in different cells","link":"/cell_entry"},{"title":"Differences in cell entry","details":"Compare how mutations affect entry in different cells","link":"/cell_entry_diffs"},{"title":"Mxra8 binding","details":"Mutation effects on Mxra8 binding (assessed by neutralization by soluble Mxra8)","link":"/mxra8_binding"},{"title":"Structural visualizations","details":"Visualizations of the deep mutational scanning on protein structures","link":"/structures"},{"title":"Phylogenetic tree","details":"Interactive phylogenetic tree with deep mutational scanning data","link":"/tree"}]},"headers":[],"relativePath":"index.md","filePath":"index.md"}'),r={name:"index.md"};function s(o,e,l,d,h,c){return n(),a("div",null,e[0]||(e[0]=[i('<h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to &quot;Overview&quot;">​</a></h2><p>This website provides interactive visualizations and raw data about the effects of mutations to the CHIKV envelope proteins as measured in the <a href="https://doi.org/10.1016/j.cell.2023.02.001" target="_blank" rel="noreferrer">pseudovirus deep mutational scanning</a> experiments described in <a href="./.html">Ju et al (2025)</a> <strong>[ADD CITATION LINK WHEN AVAILABLE]</strong>. That study measured how mutations to the CHIKV 181/25 envelope proteins affected entry in 293T-Mxra8 cells (human cells expressing the Mxra8 receptor), 293T-TIM1 cells (human cells expressing the TIM1 attachment factor), and C6/36 cells (mosquito cells). It also measured how mutations affect Mxra8 binding.</p><p>Because the datasets are so rich, the interactive visualizations here are generally a better way to explore the data than the static figures in the paper. If you just want to examine the effects of specific mutations in each of the three cell lines, <a href="cell_entry_diffs.html#differences-in-effects-across-cells" target="_self">this plot</a> will generally be the best one to look at. All the visualizations and data can be accessed by clicking on the gray boxes above for each type of measurement, namely:</p><ul><li><a href="/CHIKV-181-25-E-DMS/cell_entry.html">Cell entry</a>: effects of mutations on entry in 293T-Mxra8, 293T-TIM1, and C6/36 cells.</li><li><a href="/CHIKV-181-25-E-DMS/cell_entry_diffs.html">Differences in cell entry</a>: differences in effects of mutations on entry between each pair of cells.</li><li><a href="/CHIKV-181-25-E-DMS/mxra8_binding.html">Mxra8 binding</a>: effects of mutations on binding to Mxra8, as assessed by pseudovirus neutralization by soluble Mxra8).</li><li><a href="/CHIKV-181-25-E-DMS/structures.html">Structural visualizations</a>: effects of mutations mapped onto three-dimensional structures of the envelope proteins, as rendered by <a href="https://dms-viz.github.io/dms-viz-docs/" target="_blank" rel="noreferrer">dms-viz</a>.</li><li><a href="/CHIKV-181-25-E-DMS/tree.html">Phylogenetic tree</a>: a <a href="https://nextstrain.org/" target="_blank" rel="noreferrer">Nextstrain</a> phylogenetic tree of the genes encoding the CHIKV envelope proteins with deep mutational scanning phenotypes mapped onto the tips.</li></ul><p>See <a href="./.html">Ju et al (2025)</a> <strong>[ADD CITATION LINK WHEN AVAILABLE]</strong> for additional details about the study.</p><h2 id="biosafety" tabindex="-1">Biosafety <a class="header-anchor" href="#biosafety" aria-label="Permalink to &quot;Biosafety&quot;">​</a></h2><p>The measurements shown on this page were made using <a href="https://doi.org/10.1016/j.cell.2023.02.001" target="_blank" rel="noreferrer">pseudovirus deep mutational scanning</a> with <a href="https://blog.addgene.org/viral-vectors-101-pseudotyping" target="_blank" rel="noreferrer">lentiviral particles pseudotyped</a> with the envelope proteins from the 181/25 vaccine strain of CHIKV. These pseudoviruses do not encode any viral proteins other than the envelope proteins, and so are only able to undergo a single round of cell entry and are <strong>not</strong> fully replicative agents capable of spreading or causing disease. They therefore provide a safe way to study mutations to viral entry proteins at biosafety-level-2. In addition, the 181/25 strain of CHIKV from which the envelope proteins studied here are derived is an <a href="https://pubmed.ncbi.nlm.nih.gov/3020820/" target="_blank" rel="noreferrer">attenuated vaccine strain</a> that has been <a href="https://pubmed.ncbi.nlm.nih.gov/11304054/" target="_blank" rel="noreferrer">safety tested in humans</a>.</p><h2 id="numerical-data-additional-plots-and-computer-code" tabindex="-1">Numerical data, additional plots, and computer code <a class="header-anchor" href="#numerical-data-additional-plots-and-computer-code" aria-label="Permalink to &quot;Numerical data, additional plots, and computer code&quot;">​</a></h2><p>Links to the deep mutational scanning measurements in numerical form (eg, as CSVs) are included on each of the main pages above (eg, the <a href="/CHIKV-181-25-E-DMS/cell_entry.html">cell entry page</a> has links to the CSV files with the raw data on how mutations affect cell entry).</p><p>For more detailed documentation of the analysis (including additional interactive plots and links to CSVs) as automatically generated by <a href="https://github.com/dms-vep/dms-vep-pipeline-3" target="_blank" rel="noreferrer">dms-vep-pipeline-3</a>, see the <a href="appendix.html" target="_self">Appendix</a>.</p><p>The full computer code, processed data, and analysis pipeline is available on GitHub at <a href="https://github.com/dms-vep/CHIKV-181-25-E-DMS" target="_blank" rel="noreferrer">https://github.com/dms-vep/CHIKV-181-25-E-DMS</a>.</p>',11)]))}const u=t(r,[["render",s]]);export{p as __pageData,u as default};
